{"xrefs": [{"val": "http://sweetontology.net/phenCryo/Accumulation"}], "comments": ["This term is used both as a process and as an amount of mass added. Semantically speaking these are two distinct concepts (e.g., accumulation results in accumulation_amount of ice or snow gain), though accumulation_amount would more likely be an attribute.

The scope of this term varies depending on the definition.  Some definitions constrain themselves snow or ice added to glaciers; while others also include ice fields, snow cover, and/or floating ice.  How to resolve this depends on the scope desired.

Some definitions include additional discussion of the the physics involved which would be useful for connecting glacier ontologies to atmospheric, hydrologic, etc. ontologies.  This information should be captured no matter how the inconsistencies above are resolved."], "definition": {"val": "A material accumulation process during which the mass of snow on a surface increases.", "xrefs": ["http://orcid.org/0000-0003-4808-4736"]}, "basicPropertyValues": [{"val": "2019-04-24T18:29:18Z", "pred": "http://www.geneontology.org/formats/oboInOwl#creation_date"}, {"val": "http://orcid.org/0000-0002-4366-3088", "pred": "http://purl.org/dc/elements/1.1/creator"}]}

{"xrefs": [{"val": "SPIRE:Soil"}, {"val": "SWEETRealm:Soil"}, {"val": "LTER:535"}, {"val": "https://en.wikipedia.org/wiki/Soil"}], "subsets": ["http://purl.obolibrary.org/obo/envo#EnvO-Lite-GSC"], "comments": ["'In engineering terms, soil is referred to as regolith, or loose rock material that lies above the 'solid geology'. Soil is commonly referred to as "earth" or "dirt"; technically, the term "dirt" should be restricted to displaced soil.' https://en.wikipedia.org/wiki/Soil

" The upper limit of soil is the boundary between soil and air, shallow water, live plants, or plant materials that have not begun to decompose. Areas are not considered to have soil if the surface is permanently covered by water too deep (typically more than 2.5 meters) for the growth of rooted plants.

The lower boundary that separates soil from the nonsoil underneath is most difficult to define. Soil consists of horizons near the Earth's surface that, in contrast to the underlying parent material, have been altered by the interactions of climate, relief, and living organisms over time. Commonly, soil grades at its lower boundary to hard rock or to earthy materials virtually devoid of animals, roots, or other marks of biological activity. For purposes of classification, the lower boundary of soil is arbitrarily set at 200 cm."  Soil taxonomy, 2nd Ed., quoted in http://www.nrcs.usda.gov/wps/portal/nrcs/detail/soils/edu/?cid=nrcs142p2_054280"], "synonyms": [{"val": "regolith", "pred": "hasBroadSynonym", "xrefs": []}], "definition": {"val": "Soil is an environmental material which is primarily composed of minerals, varying proportions of sand, silt, and clay, organic material such as humus, gases, liquids, and a broad range of resident micro- and macroorganisms.", "xrefs": ["https://en.wikipedia.org/wiki/Soil"]}, "basicPropertyValues": [{"val": "The various 'has part' and 'has quality' relations may not hold true for all soils; however, I have yet to find counter examples. Require input from a pedologist or similar. [pbuttigieg]", "pred": "http://purl.obolibrary.org/obo/IAO_0000116"}]}
